import React, { Component } from 'react';

import * as C from './style';

class Cell extends Component {
  render() {
    console.log('THIS.PROPS =====', this.props.children);
    return <C.Wrapper {...this.props}>{JSON.stringify(this.props)}</C.Wrapper>;
  }
}

export default Cell;
